import React from 'react';
import * as style from "../../css/light/indexMenu";

export default function IndexMenu({index}) {
  const convertData = () => {
    let temp = []
    Object.keys(index).slice(1).forEach((item, i) => {
      temp.push(item[0])
    })
  
    return temp.splice(1)
  }

  const renderIndexOther = () => {
    return convertData.map((item, i) => (
      <div style={style.indexStyle}>{item[0]}</div>
    ))
  }

  return (
    <div style={style.containerStyle}>
      <div style={style.containerMainStyle}>{index[0][0]}
      </div>
      <div style={style.indexStyle}>
        {renderIndexOther()}
      </div>
    </div>
  )
}
